import React from 'C:/Users/bdoshi/AppData/Local/Microsoft/TypeScript/2.9/node_modules/@types/react';
import { BrowserRouter , Route , Switch } from 'C:/Users/bdoshi/AppData/Local/Microsoft/TypeScript/2.9/node_modules/@types/react-router-dom';
import { AboutList } from './containers/about/aboutList';
import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <BrowserRouter>
        <Switch>
          <Route path="/admin/about" component={AboutList} />
        </Switch>
      </BrowserRouter>
    </div>
  );
}

export default App;
